"use strict";

function findDisappearedNumbers(nums) {
    for (let num of nums) {
        let idx = Math.abs(num) - 1;
        if (nums[idx] > 0) {
            nums[idx] *= -1;
        }
    }
    return nums.filter((v, i) => v > 0).map((v, i) => i + 1);
}
